import matplotlib.pyplot as plt
import matplotlib.patches as mpatches
import numpy as np

def plotMap(data):
    plt.figure(figsize=(30,30), dpi=300)

    im = plt.imshow(data, interpolation='none')

    colors =[
        im.cmap(im.norm(400)),
        im.cmap(im.norm(-255)),
        im.cmap(im.norm(200)),
        im.cmap(im.norm(0))
            ]

    patches = [
        mpatches.Patch(color=colors[0], label="Ponto Inicial"),
        mpatches.Patch(color=colors[1], label="Obstáculo"),
        mpatches.Patch(color=colors[2], label="Livre com visão"),
        mpatches.Patch(color=colors[3], label="Livre sem visão")
            ]

    plt.legend(handles=patches, loc=4, prop={'size': 25})
    plt.axis('off')
    plt.savefig('C:\\Users\\Beto\\Desktop\\Projetos\\MobileRobot\\Img\\plotVisibility.png', bbox_inches="tight")
    plt.show()



